  `status` enum('1','0') default '1',
  KEY `signup` (`signup_id`),
  CONSTRAINT `FK_notifications` FOREIGN KEY (`signup_id`) REFERENCES `signup` (`signup_id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

